  return (
    <main>
      <div className="container">
        <div className="question">
          <div className="header">
            <h4>{title}</h4>
            <div className="btn">
              <AiOutlinePlus />
            </div>
          </div>
          <p></p>
        </div>
      </div>
    </main>
  );
};

export default Question;
